import React from 'react'
import Chatbot from './Chatbot'
import Showresult03 from './Showresult03'
import Showresult04 from './Showresult04'
import Showresult05 from './Showresult05'
import { useState } from 'react';
import "./Home.css"
export default function Homeadm() {
  const [showResultContent, setShowResultContent] = useState(false);
  const [showResultContent01,setShowResultContent01] = useState(false);
  const [showResultContent02,setShowResultContent02] = useState(false);
  const handleClick01 = () => {
    setShowResultContent(true);
  };
  const handleClick02 = () => {
    setShowResultContent01(true);
  };
  const handleClick03 = () => {
    setShowResultContent02(true);
  };
  return (
    <>
      <nav className="navbar navbar-light bg-info">
        <h2 className="navbar-brand mb-0 h1">MALLA REDDY COLLEGE OF ENGINEERING & TECHNOLOGY</h2>
        <nav className="navbar navbar-light bg-info">
          <h4>Welcome Admin</h4>
        </nav>
      </nav>
      <nav className="navbar navbar-light bg-warning">
        <marquee>
          <h3 className="navbar-brand mb-0 h1">Highest Package AC.Yr 2024:</h3>
        </marquee>
      </nav><br></br><br></br>
      <div className="main-content text-center">
        <div className="button-container text-center">
          <button className="btn btn-success" onClick={handleClick01}>Show Student Details</button><br></br><br></br>
          {showResultContent && <Showresult03 />}<br></br><br></br> 
          <button className="btn btn-info" onClick={handleClick02}>Schedule Mock Interview</button><br></br><br></br>
          {showResultContent01 && <Showresult04 />}<br></br><br></br> 
          <button className="btn btn-success" onClick={handleClick03}>Track Application</button><br></br><br></br>
          {showResultContent02 && <Showresult05 />}<br></br><br></br> 
        </div>
      </div>
      <Chatbot/>
    </>
  )
}
